import logo from './argisl.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <App />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Bienvenidos a ArgisLab
        </p>
        <a
          className="App-link"
          href="https://platzi.com/reactjs"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}


function TodoItem(){
  return (
    <li>
        <span>V</span>
        <p>Llorar con la llorona </p>
        <span>X</span>
    </li>
  );

}


export default App;
